  false,\n\t\"url\": null,\n\t\"notes\": \"Objectives were to determine breeding populations
  of birds by weekly ground censuses on established transects 2) monitor waterbird
  use of wetlands and maintain an avian phenology chart and 3) sample macroinvertebrates
  in small tundra ponds subjected to oil spills in order to assess long-term recovery
  rates. 4) prepare cover maps of plots in Loon and Phalarope lakes 5) compile species
  list and collection of plants in Loon and Phalarope lakes 6) do vegetation line
  transects in the lakes to determine frequency 7) record caribou movement, herd size
  and composition and record arctic fox activity and 8) determine population levels
  of small mammals.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
